function PinnedTabs(){this.PINNED_TABS_COOKIE="pinned-tabs";this.lookup={}}PinnedTabs.method("get",function(a){var c=[];this.lookup={};for(var b=0;b<a.length;b++){if(a[b].pinned){this.lookup[a[b].url.removeQuery()]=true;c.push(a[b].url)}}return c});PinnedTabs.method("exists",function(a){return !!this.lookup[a.removeQuery()]});var PinnedTabsHandler=new PinnedTabs();